import React from 'react'
import {useState} from 'react'

function Pagination(props) {
    console.log('current page is = ', props.currentPage);

    let [activepages,setactivePages]=useState(1)

    let numberofPages=[]

    for(let i=1; i<=Math.ceil(props.filterdDishes.length/props.itemsperPage); i++){
        numberofPages.push(i)

    }

    function currentpageseter(event){

        let currentPage = event.target.id
        setactivePages(currentPage)
        //console.log('activepages',activepages);
        props.setCurrentPage(currentPage)
        console.log('after set current page is =' , activepages);


    }

    let page= numberofPages.map((pageNumber)=>{
        return(
            <li id={pageNumber} className={pageNumber === activepages ? "active" : ""} onClick={currentpageseter}>
                {pageNumber}
            </li>
        )
    })

  return (
    <section>
        <ul className='pagination flex'>
            {page}
        </ul>
    </section>

  )
}

export default Pagination
